description:
A long time ago, The Lands were filled with magic and it had given extreme powers to The Wizards who abuse their power and creating chaos throughout The Lands. A group of Wizard known as The Ancients was determined to end the chaos. They were able to contain magic by turning it into crystal. Without magic the chaos finally stopped and The Dark Time of Wizard was ended.Until Irimant the Warlock discovered the magic crystal and decided to break it and bring magic once again. Corrupted by the crystal, The Warlock send his minions to destroy everything in their path. The Lands once again descend into chaos.
